import{_ as a,o as e,c as t,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 23.1-636 Virginia Guaranteed Assistance Program; Council to adopt regulations.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-636.md","filePath":"vacode/23.1-636.md"}'),r={name:"vacode/23.1-636.md"},o=i('<h1 id="§-23-1-636-virginia-guaranteed-assistance-program-council-to-adopt-regulations" tabindex="-1">§ 23.1-636 Virginia Guaranteed Assistance Program; Council to adopt regulations. <a class="header-anchor" href="#§-23-1-636-virginia-guaranteed-assistance-program-council-to-adopt-regulations" aria-label="Permalink to &quot;§ 23.1-636 Virginia Guaranteed Assistance Program; Council to adopt regulations.&quot;">​</a></h1><p>A. The Virginia Guaranteed Assistance Program is created to provide financial assistance in the form of grants to eligible students for the costs of attending a public institution of higher education. Funds may be paid to any public institution of higher education on behalf of students who have been awarded grants pursuant to § <a href="http://law.lis.virginia.gov/vacode/23.1-638/" target="_blank" rel="noreferrer">23.1-638</a>.</p><p>B. The Council shall adopt regulations for the implementation of the provisions of this article.</p><p>1992, c. 879, § 23-38.53:4; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0789" target="_blank" rel="noreferrer">789</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[o];function s(c,l,d,g,u,p){return e(),t("div",null,n)}const f=a(r,[["render",s]]);export{_ as __pageData,f as default};
